import { type } from 'os';
import React from 'react';
import { useNavigate } from 'react-router-dom';

type Props = {
    children: string;
    // onClick: () => void;
    size: number;
}

const ProfileButton: React.FC<Props> = ({ size }) => {
    const navigate = useNavigate();

    const onClick = () => {
      navigate("/SettingPage");
    };

    return (
        <button style={{
            position: 'fixed',
            width: size,
            height: size,
            backgroundImage: "url('data:image/jpeg;base64,')",
            borderRadius: '50%',
            color: 'red',
            display: 'flex',
            justifyContent: 'center',
            alignItems: 'center',
            cursor: 'pointer',
            // backgroundColor: "blue",
            // border: "none",
            fontSize: "16px",
            fontWeight: "bold",
            top: '1rem',
            right: '1rem',
            // top: "10px",
            // right: "100px",
            outline: 'none',
            transform: 'translate(0%, 0%)',
            // transform: "translate(280%,-80%)",
            zIndex: 9999,
        }}
            onClick={onClick}>
            User Profile
        </button>
    );
};

export default ProfileButton;
